import React from 'react';
import './bloodPressure.scss';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

interface IProps {}
interface IState {
    formData: {
        sysBp: number | undefined,
        diaBp: number | undefined,
        atDate: Date,
        classification: string | undefined,
    }
}

class Hypertension extends React.PureComponent<IProps, IState> {
    constructor(props: IProps) {
        super(props)

        this.state = {
            formData: {
                sysBp: undefined,
                diaBp: undefined,
                atDate: new Date(),
                classification: undefined,
            }
        }
    }

    formatDate(date: Date) {
        // let date = new Date();
        return `${date.getFullYear().toString()}-${(date.getMonth() + 1).toString().padStart(2, "0")}-` +
            `${date.getDate().toString().padStart(2, "0")}`;
    }

    postData = async (url = '', data = {}) => {
          const response = await fetch(url, {
            method: 'POST',
            mode: 'cors',
            cache: 'no-cache',
            credentials: 'same-origin',
            headers: {
                'Content-Type': 'application/json',
            },
            redirect: 'follow',
            referrer: 'no-referrer',
            body: JSON.stringify(data),
        });
        return await response.json();
    }

    inputChangedHandler(date: any) {
        console.log(date);
        const formData = Object.assign({}, this.state.formData);
        formData.atDate = date;
        this.setState({ formData:  formData });
    }

    render() {

        // console.log(this.state);

        // this.postData(`${process.env.REACT_APP_API_URL}/hypertension`, { sysBp: 180, diaBp: 80, atDate: Date.now() })
        // .then(data => console.log(data))
        // .catch(error => console.error(error));

        return <React.Fragment>
            <div className="hypertension-form-input">
            <label className="form-lbl">Systole</label><input id="sysBp" autoComplete="off"/><label className="form-units">mmHg</label>
            <label className="form-lbl">Diastole</label><input id="diaBp" autoComplete="off"/><label className="form-units">mmHg</label>
            {/* <label className="form-lbl">Date</label><input id="atDate" type="date" value={this.formatDate(this.state.formData.atDate)} onChange={(event)=>this.inputChangedHandler(event.target.value)}/> */}

        </div>
        <DatePicker
        selected={this.state.formData.atDate}
        onChange={(event) => this.inputChangedHandler(event)}
      />
        </React.Fragment>
    }
}

export default Hypertension;
